var res=null
if($('Quality_Control.QC_F2:stage_contraindicated_ecg').eq(0).and(
   $('clsa-dcs-f2.ECG:RES_XML_FILE').isNull().not()).value()) {
  var ecg=newValue(null,'datetime')
  try {   
    ecg=newValue(
    $('clsa-dcs-f2.ECG:RES_MEASUREMENT_DATE').value() + ' ' +
    $('clsa-dcs-f2.ECG:RES_MEASUREMENT_TIME').value(), 'datetime')  
  } catch(e) {  
  }

  if(ecg.isNull().not().and(ecg.time().gt(0)).value()) {
    var ecgTime=ecg.time()
    var preIndex=-1
    var postIndex=-1    
    var pre=newValue(null,'datetime')
    var post=newValue(null,'datetime')
    var minPre=10000000000000000
    var minPost=minPre
    var stages=$('clsa-dcs-f2.Participants:Admin.StageInstance.stage').asSequence()
    for(var i=0;i<stages.size();i++) {
      var stage=stages.valueAt(i).value()
      if('ECG'==stage) continue
      var isQ = -1!=$this('group_questionnaire').indexOf(stage)
      var isI = -1!=$this('group_instrument').indexOf(stage)
      if(!(isQ || isI)) continue
      if(isQ) {
        pre=$('clsa-dcs-f2.'+stage+':QuestionnaireRun.timeEnd')
      } else  {
        pre=$('clsa-dcs-f2.'+stage+':InstrumentRun.timeEnd')
      }
      if(ecg.after(pre).value()) {
        var p=ecgTime.minus(pre.time()).value()
        if(p<minPre) {
          minPre=p
          preIndex=i
        }        
      } else {  
        if(isQ) {
          post=$('clsa-dcs-f2.'+stage+':QuestionnaireRun.timeStart')
        } else {
          post=$('clsa-dcs-f2.'+stage+':InstrumentRun.timeStart')
        }
        if(ecg.before(post).value()) {
          var p=post.time().minus(ecgTime).value()
          if(p<minPost) {
            minPost=p
            postIndex=i
          }
        }
      }
    }// end for loop
    if(-1!=preIndex && preIndex<postIndex) {
      res=newSequence([preIndex,postIndex],'integer')
    }  
  }  
}
res

